<style>
body {
	overflow: hidden;

  margin: 0;
  padding: 0;

}
svg {height: 155vh; 
overflow: hidden;
margin: -22% 0 0  -12%;
z-index: 2;
}

#play-pause-button{
	position: fixed;
bottom: 0;
right: 0;
text-align: right;
  font-size: 10vh;
  cursor: pointer;
  color: #ef4871;
z-index: 1;
}

@keyframes fuckk {
   50% {filter: grayscale(100%);}  
}


svg, #play-pause-button     {
animation-name: fuckk;
    animation-duration: 20s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;

} 

@keyframes floating {
    from { transform: translate(0,  0px); }
    65%  { transform: translate(0, 5px); }
    to   { transform: translate(0, -0px); }    
}


#ball, #ball-2, #ball-3, #ball-4, #ball-5, #ball-6, #ball-7,#ball-8,#ball-9,#ball-10,#ball-11,#ball-12, .cls-119      {
animation-name: floating;
    animation-duration: 3s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out;
}  


@keyframes haha {
  30% {
    transform: rotateY(3deg);}

    60% {
    transform: rotateZ(-.03deg);}

}


#lips  {
  animation: haha 3s infinite linear;
}  


@keyframes lmfao {
  50% {
    transform: rotateZ(-1deg);}

    80% {
    transform: rotateZ(-.04deg);}

}


#smoke-2  {
  animation: lmfao 5s infinite linear;
}  

 .cls-116 {  
   -webkit-animation-name: example; /* Safari 4.0 - 8.0 */
  -webkit-animation-duration: 10s; /* Safari 4.0 - 8.0 */
  -webkit-animation-iteration-count: infinite; /* Safari 4.0 - 8.0 */
  animation-name: example;
  animation-iteration-count: infinite;
}
/* Safari 4.0 - 8.0 */
@-webkit-keyframes example {
  50%   {fill:#4E4C4F;}
  100%   {fill:black;}
 }

 .cls-117 {
   -webkit-animation-name: ok; /* Safari 4.0 - 8.0 */
  -webkit-animation-duration: 10s; /* Safari 4.0 - 8.0 */
  -webkit-animation-iteration-count: infinite; /* Safari 4.0 - 8.0 */
  animation-name: ok;
  animation-iteration-count: infinite;
}
/* Safari 4.0 - 8.0 */
@-webkit-keyframes ok {
  50%   {fill:black;}
  100%   {fill:#BEB7AD;}
 }

  .cls-118 {
   -webkit-animation-name: hehe; /* Safari 4.0 - 8.0 */
  -webkit-animation-duration: 10s; /* Safari 4.0 - 8.0 */
  -webkit-animation-iteration-count: infinite; /* Safari 4.0 - 8.0 */
  animation-name: hehe;
  animation-iteration-count: infinite;
}
/* Safari 4.0 - 8.0 */
@-webkit-keyframes hehe {
  50%   {fill:#BEB7AD;}
  100%   {fill:#4E4C4F;}
 }
}

$('#play-pause-button').on("click",function(){
  if($(this).hasClass('fa-play'))
   {
     $(this).removeClass('fa-play');
     $(this).addClass('fa-pause');

   {
     $(this).removeClass('fa-pause');
     $(this).addClass('fa-play');
     audio.pause();
   }
});</script>
